import React, {Component} from "react";
import axios from 'axios'


class SourceIp extends Component{
    constructor(props){
        super(props)
        this.state = {
            ips: []
        }
    }
    componentDidMount(){
        axios.get('http://127.0.0.1:5000/srcip/10')
        .then((response)=>{
            console.log(response)
        })
        .catch(error => {
            console.log(error)
        })
    }
    render() {
        return (
            <div>hi</div>
        )
    }
}

export default SourceIp
